column8:
CONVERSE ALLSTAR 100 COLORS HI peach<br>アッパー：キャンバス<br>アウトソール：ラバー2017年で生誕100年を迎えた「ALL STAR」を記念して、よりタフに、快適に進化した「ALL STAR 100」がデビュー
春の足元に映えるパステルカラーのアイテム。フルーツ名を冠した2カラー（ピンクはピーチ、イエローはレモン）展開。定番のオールスターとは異なる織のキャンバスを採用する記念モデル。<br><br>【 ALL STAR 100 HI スペック 】<br>・REACTカップインソール、TractionSoleを搭載。<br>・メモリーフォームでホールド感を向上させたタンでホールド感とタンの撚れを軽減。<br>・星部分にメタリックプリントを施した新アンクルパッチを採用。<br>・ロゴのすり減りを軽減するコーティングを施したオリジナルヒールラベルを採用。<br>・撥水加工したシューレースとコーティングしたハトメで黒ずみを軽減。<br>・フォーム内蔵のメッシュライニングには消臭抗菌加工を採用。<br>・オリジナルタグ、カートン付属。<table border="0" align="center" width="700" cellpadding="2" cellspacing="2">

